import "./App.css";
import Button from "./components/Button/Button";

function App() {
  return (
    <div className="App">
      <Button text="Log in" type="login" />
      <Button text="Sign up" type="signup" />
      <button> just a normal button </button>
    </div>
  );
}

export default App;
